import login from './rent/login.js';
import Layout from './rent/home.js';
import { BrowserRouter, Routes, Route } from "react-router-dom";
function App() {
  return (

      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout/>} />
        <Route path="/login" element={<login/>} />

        </Routes>
    </BrowserRouter>


  )
}

export default App;
